import { ContractTypesMap } from "hardhat/types";
import {
  developmentChains,
  networkConfig as allNetworkConfig,
} from "../helper-hardhat-config";
import hre from "hardhat";
import { parseEther, PublicClient, WalletClient } from "viem";
import dynamicSvgNftModule from "../ignition/modules/DynamicSvgNft.deploy";
import { loadFixture } from "@nomicfoundation/hardhat-network-helpers";
import { expect } from "chai";

const lowSvgURI =
  "data:image/svg+xml;base64,";
const highSvgURI =
  "data:image/svg+xml;base64,";

const highURI =
  "data:application/json;base64,";
const lowURI =
  "data:application/json;base64,";

!developmentChains.includes(hre.network.name)
  ? describe.skip
  : describe("DynamicSvgNftUnit", () => {
      let dynamicSvgNft: ContractTypesMap["DynamicSvgNft"],
        mockV3Aggregator: ContractTypesMap["MockV3Aggregator"];
      let publicClient: PublicClient;
      let deployer: WalletClient, wallet1: WalletClient, wallet2: WalletClient;
      let deployedAddresses = { dynamicSvgNft: "", mockV3Aggregator: "" };
      const chainId = hre.network.config.chainId!;
      const networkConfig = allNetworkConfig[chainId];

      async function deployContracts() {
        const { dynamicSvgNft, mockV3Aggregator } = await hre.ignition.deploy(
          dynamicSvgNftModule
        );

        deployedAddresses.dynamicSvgNft = dynamicSvgNft.address;
        deployedAddresses.mockV3Aggregator = mockV3Aggregator!.address;

        return {
          dynamicSvgNft,
          mockV3Aggregator: mockV3Aggregator!,
        };
      }

      async function getClients() {
        const publicClient = await hre.viem.getPublicClient();
        const [deployer, wallet1, wallet2] = await hre.viem.getWalletClients();
        return { publicClient, deployer, wallet1, wallet2 };
      }

      before(async () => {
        ({ publicClient, deployer, wallet1, wallet2 } = await getClients());
      });

      beforeEach(async () => {
        ({ dynamicSvgNft, mockV3Aggregator } = await loadFixture(
          deployContracts
        ));
      });

      describe("Minting", () => {
        it("Base64 encoding is correctly done and dynamically assigns uri according to price feed", async () => {
          const lsu = await dynamicSvgNft.read.encodeSvgToBase64URI([
            networkConfig.lowSVG,
          ]);
          const hsu = await dynamicSvgNft.read.encodeSvgToBase64URI([
            networkConfig.highSVG,
          ]);
          expect(lsu).to.equal(lowSvgURI);
          expect(hsu).to.equal(highSvgURI);
          const highValue = await dynamicSvgNft.write.mintNFT([3000n]);
          expect(await dynamicSvgNft.read.tokenURI([0n])).to.be.equal(lowURI);
          const anotherhighValue = await dynamicSvgNft.write.mintNFT([2000n]);
          expect(await dynamicSvgNft.read.tokenURI([1n])).to.be.equal(highURI);
        });
      });
    });
